import React from 'react';

export default {
  UsersList: {
    path: '/gighub-users/',
    component: React.lazy(() =>
      import('../components/UsersList' /* webpackChunkName: "UsersList" */),
    ),
  },

  UserProfile: {
    path: '/profile/', // :id
    component: React.lazy(() =>
      import('../components/UserProfile' /* webpackChunkName: "UserProfile" */),
    ),
  },
};
